import React from "react";
import Navbar from "./Navbar";
import { makeStyles } from "@material-ui/core/styles";
import {
  Box,
  Grid,
  Card,
  CardActionArea,
  CardActions,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@material-ui/core";

const Portfolio = () => {
  return (
    <>
      <Navbar />
      <div style={{ color: "white" }}>This is the Portfolio Component</div>
    </>
  );
};

export default Portfolio;
